import React, { useState } from 'react'
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './LoginPage.css';
import LoginImage from '../../Assets/11235651_10862.jpg';
import axios from 'axios';
import { MDBContainer, MDBRow, MDBCol, MDBIcon, MDBInput, MDBBtn } from 'mdb-react-ui-kit';


const LoginPage = () => {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [errors, setErrors] = useState({});
    const [isValid, setIsValid] = useState(false);
    const [maskedPassword, setMaskedPassword] = useState('');
    // Handle password change and mask it with asterisks
    const handlePasswordChange = (event) => {
        let value = event.target.value;


        // Check if data is being pasted
        if (event.clipboardData && event.clipboardData.getData) {
            value = event.clipboardData.getData('Text');

        }

        setPassword(value);

        setIsValid(validatePassword(value));
    };

    const validatePassword = (value) => {
        const minLength = 8;
        let isValid = true;
        const newErrors = {};

        if (!value) {
            newErrors.password = 'Password is required';
            isValid = false;
        } else if (value.length < minLength) {
            newErrors.password = `Password must be at least ${minLength} characters long`;
            isValid = false;
        }
        setErrors(newErrors);
        return isValid;
    };

    const maskPassword = (value) => {
        return "*".repeat(value.length);
    };
    // Validate email and password
    const validateForm = () => {
        const newErrors = {};
        let isValid = true;
        // Email validation
        if (!email) {
            newErrors.email = 'Email is required';
            isValid = false;
        } else if (!/\S+@\S+\.\S+/.test(email)) {
            newErrors.email = 'Email is invalid';
            isValid = false;
        }
        //Password validation
        if (!password) {
            newErrors.password = 'Password is required';
            isValid = false;
        }
        setErrors(newErrors);
        return isValid;
    };
    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        if (validateForm()) {
            // Form submission logic goes here
        }
    };
    const logindata = async () => {

        const loginuser = {
            email: email,
            password: password
        }
        console.log(loginuser)

        // fetch(`https://localhost:7190/api/Owner/authenticate`,{
        //   method:"POST",
        //   headers:{
        //     "Content-Type":"application/json",
        //   },
        //   body:JSON.stringify(loginuser),
        // })
        // .then(response => {
        //   if (response ===200) {
        //     console.log("Login Successfully"); 
        //   }
        //   return response.json();
        // })
        // .catch(error=>{
        //   console.error("login error in:",error);
        // })
        try {
            const response = await axios.post('https://localhost:7190/api/Owner/authenticate', loginuser);
            console.log('Response:', response.data); // You can handle the response data as needed
            // Perform any actions you need with the response data here
        } catch (error) {
            console.error(error);
        }
    };


    return (
        <MDBContainer breakpoint="sm" fluid>
          <MDBRow className="split">
            <MDBCol lg="6" className="split2">
              <div>
                <img src={LoginImage} className="image" alt="Login" />
              </div>
              <div className="member">Already not a member? Register Here</div>
            </MDBCol>
            <MDBCol lg="6" className="split1">
              <div className="head">Sign In</div>
              <div>
                <div className="flex">
                  <div>
                    <MDBIcon fas icon="envelope" />
                  </div>
                  <div>
                    <MDBInput
                      type="email"
                      label="Your Email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                    />
                  </div>
                </div>
                <hr />
                {/* Display email validation error if it exists */}
                {errors.email && <span className="error">{errors.email}</span>}
                <div className="flex">
                  <div>
                    <MDBIcon fas icon="fingerprint" />
                  </div>
                  <div>
                    <MDBInput
                      type="password"
                      label="Your Password"
                      value={password}
                      onChange={handlePasswordChange}
                    />
                  </div>
                </div>
                <hr />
                {/* Display password validation error if it exists */}
                {errors.password && <span className="error">{errors.password}</span>}
                {isValid && <p>Password is valid</p>}
                <br />
                <MDBBtn color="primary" className="butn" onClick={handleSubmit}>
                  Login
                </MDBBtn>
              </div>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
    )
}

export default LoginPage
